import React from 'react';
import "../styles/PlayingCards.css";

const PlayingCards = ({roomCode, card}) => {
    return(
        <div className='playing-cards'>
            <h2>Выберите город, в котором вы хотите разыграть <span className='accent'>{card.name}</span></h2>
        </div>
    )
}

export default PlayingCards;
